#include "strprinter.h"

#define StrPrinter_ColorLevel								16

#define StrPrinter_GetWidth(n)							((float)(*(uint16_t *)n) / 256.0)
#define StrPrinter_ColorMap(from, to, r)	 (( (((uint32_t)(from >> 00) & 0x1f) * (StrPrinter_ColorLevel - r) + ((uint32_t)(to >> 00) & 0x1f) *  r) / StrPrinter_ColorLevel ) | \
																						(( (((uint32_t)(from >> 05) & 0x3f) * (StrPrinter_ColorLevel - r) + ((uint32_t)(to >> 05) & 0x3f) *  r) / StrPrinter_ColorLevel ) << 5) | \
																						(( (((uint32_t)(from >> 11) & 0x1f) * (StrPrinter_ColorLevel - r) + ((uint32_t)(to >> 11) & 0x1f) *  r) / StrPrinter_ColorLevel ) << 11))
#define StrPrinter_GetCh(map, n)						(map + (((uint16_t *)(map + 1))[n - 32]))
#define StrPrinter_GetPX(cmap, level)				(cmap + ((uint16_t *)cmap)[level + 1])

#define SP_BUFFER(x, y)											SP_Buffer[x + y * SP_Buffer_Width]
#define SP_VALID(x, y)											(((x) < SP_Buffer_Width) ? (((y) < SP_Buffer_Height) ? 1 : 0) : 0)

uint8_t  SP_Brush_Opacity = 0xff;
uint32_t SP_Buffer_Width = 0;
uint32_t SP_Buffer_Height = 0;
uint32_t SP_Buffer_Length = 0;
uint16_t SP_Buffer[160 * 16];

void SP_GetRect(const char *map, char *str, uint8_t xoffset, uint32_t *width, uint32_t *height)
{
	char ch = 0;
	uint32_t cursor_x_256 = xoffset << 5;
	while((ch = *str ++) != 0)
	{
		//uint32_t cursor_x_8per = (cursor_x_256 >> (8 - 3)) & 0x07;		
		cursor_x_256 += *(uint16_t *)StrPrinter_GetCh(map, ch);
	}
	if(cursor_x_256 & 0xff)
	{
		*width = (cursor_x_256 >> 8) + 1;
	}
	else
	{
		*width = cursor_x_256 >> 8;
	}
	*height = *map;
}
void SP_PrepareRect(const char *map, char *str, uint8_t xoffset)
{
	SP_GetRect(map, str, xoffset, &SP_Buffer_Width, &SP_Buffer_Height);
	SP_Buffer_Length = SP_Buffer_Width * SP_Buffer_Height;
}
void SP_FillBuffer_SolidBrush(uint16_t color)
{
	for(int i = 0; i < SP_Buffer_Length; i++)
	{
		SP_Buffer[i] = color;
	}
}
void SP_CoverString(const char *map, char *str, uint8_t xoffset, uint16_t foreColor)
{
	uint32_t cursor_x_256 = xoffset << 5;
	uint32_t cursor_x = 0;
	uint32_t cursor_x_8per = 0;
	char ch = 0;
	while((ch = *str++) != 0)
	{
		cursor_x = cursor_x_256 >> 8;
		cursor_x_8per = (cursor_x_256 >> 5) & 0x07;
		
		char *chMap = (char *)StrPrinter_GetCh(map, ch);
		char *pxMap = (char *)StrPrinter_GetPX(chMap, cursor_x_8per);
		char *pxData = pxMap + 2;
		
		uint8_t chWidth = *pxMap;
		uint8_t chOffset = pxMap[1];
		
		uint32_t cirCnt = 0;
		for(int y = 0; y < SP_Buffer_Height; y++)
		{
			for(int x = 0; x < chWidth; x++)
			{
				uint32_t t_x = x + cursor_x;
				//if(t_x < chOffset) { continue; }
				t_x -= chOffset;
				uint16_t bakColor = SP_BUFFER(t_x, y);
				uint8_t level = 0;
				if(cirCnt & 1)
				{
					level = pxData[cirCnt >> 1] >> 4;
				}
				else
				{
					level = pxData[cirCnt >> 1] & 0x0f;
				}
                level = level * SP_Brush_Opacity / 255;
				uint16_t resColor = StrPrinter_ColorMap(bakColor, foreColor, level);
				if(SP_VALID(t_x, y))SP_BUFFER(t_x, y) = resColor;
				cirCnt ++;
			}
		}
		cursor_x_256 += *(uint16_t *)chMap;
	}
}

